import React, {Component} from 'react';
import '../css/ContentHandler.css';
import Home from './home/Home.js';
import TunaNavBar from './TunaNavBar.js';
import TunaTimes from './weeklytimes/TunaTimes.js';
import CharlieFormula from './charlieformula/CharlieFormula.js';
import MembersPage from './members/MembersPage.js';
import Landing from './landingpages/Landing.js';

class ContentHandler extends Component {
    constructor(props) {
        super(props);
        this.state = {
            currPage: 'landing'
        }

        this.goLanding = this.goLanding.bind(this);
        this.goHome = this.goHome.bind(this);
        this.goTimes = this.goTimes.bind(this);
        this.goCharlie = this.goCharlie.bind(this);
        this.goMembers = this.goMembers.bind(this);
    }
    
    goLanding() {
        this.setState({currPage: 'landing'});
    }
    goHome() {
        this.setState({currPage: 'home'});
    }
    goTimes() {
        this.setState({currPage: 'times'});
    }
    goCharlie() {
        this.setState({currPage: 'charlie'});
    }
    goMembers() {
        this.setState({currPage: 'members'});
    }

    showNavBar() {
        if(this.state.currPage != 'landing') {
            return(
                <TunaNavBar goHome={this.goHome}
                    goTimes={this.goTimes}
                    goCharlie={this.goCharlie}
                    goMembers={this.goMembers}
                    goLanding={this.goLanding}/>
            )
        }
    }

    // chooses which page to render
    pagePicker() {
        if(this.state.currPage == 'landing') {
            return(
                <Landing goHome={this.goHome}/>
            )
        }
        if(this.state.currPage == 'home') {
            return(
                <Home/>
            )
        }
        if(this.state.currPage == 'times') {
            return(
                <TunaTimes/>
            )
        }
        if(this.state.currPage == 'charlie') {
            return(
                <CharlieFormula/>
            )
        }
        if(this.state.currPage == 'members') {
            return(
                <MembersPage/>
            )
        }
    }

    render() {
        return(
            <div className='Wrapper'>
                {this.showNavBar()}
                <div className="pageWrapper">
                    {this.pagePicker()}
                </div> 
            </div>
        );
    }
}

export default ContentHandler;
